('@AnKiiim_ @BabehAldoAje135 Untuk DPR mana Hak angketnya??? jika benar peduli pada pemilu dan pilpres LUBER (ga pake sirekap) jurdil (ga pake cawe cawe) maka mestinya gulirkan HAK ANGKET dan jangan diarahkan ke MK ', 'hak ga pake cawe ankiiim babehaldoaje dpr angket peduli milu pilpres luber sirekap jurdil mesti gulir angket arah mk'),
